(133, 'Tuyển dụng tháng 12', 'tuyen-dung-thang-12', 'Công Ty TNHH Công Nghệ & Dịch Vụ Toàn Năng', NULL, NULL, NULL, NULL, NULL, 1, 137),
(134, 'Tuyển dụng tháng 11', 'tuyen-dung-thang-11', 'Công Ty TNHH Công Nghệ & Dịch Vụ Toàn Năng', NULL, NULL, NULL, NULL, NULL, 1, 138),
(135, 'Giải đáp những câu hỏi trắc nghiệm hóa 12 thú vị được ứng dụng trong thực tế', 'giai-dap-nhung-cau-hoi-trac-nghiem-hoa-12-thu-vi-duoc-ung-dung-trong-thuc-te', 'Giải đáp những câu hỏi trắc nghiệm hóa 12 thú vị được ứng dụng trong thực tế', NULL, '<p>Bạn c&oacute; cảm thấy th&uacute; vị mỗi khi m&igrave;nh tự tin sử dụng những kiến thức đ&atilde; học để l&yacute; giải cho c&aacute;c sự việc trong thực tế một c&aacute;ch thật mạch lạc, tr&ocirc;i chảy? Chắc chắn ai trong ch&uacute;ng ta cũng đều như vậy. Nếu đ&atilde; l&agrave; người đam m&ecirc; c&aacute;c m&ocirc;n khoa học, bạn h&atilde;y thử t&igrave;m đ&aacute;p &aacute;n cho c&aacute;c c&acirc;u hỏi&nbsp;<strong>trắc nghiệm h&oacute;a 12</strong>&nbsp;hết sức th&uacute; vị dưới đ&acirc;y để xem thử ứng dụng của ho&aacute; trong đời sống như thế n&agrave;o nh&eacute;!</p>\r\n\r\n<p><strong>C&acirc;u 1:</strong>&nbsp;Ở những v&ugrave;ng vừa c&oacute; lũ qua, nước rất đục kh&ocirc;ng d&ugrave;ng trong sinh hoạt được, người ta d&ugrave;ng ph&egrave;n chua l&agrave;m trong nước, t&aacute;c dụng đ&oacute; của ph&egrave;n chua l&agrave; do:</p>\r\n\r\n<p>A. Trong nước ph&egrave;n tạo ra Al(OH)<sub>3</sub>&nbsp;dạng keo c&oacute; khả năng hấp phụ c&aacute;c chất lơ lửng l&agrave;m ch&uacute;ng kết tủa xuống.</p>\r\n\r\n<p>B. Ph&egrave;n t&aacute;c dụng với c&aacute;c chất lơ lửng tạo ra kết tủa.</p>\r\n\r\n<p>C. Tạo m&ocirc;i trường axit h&ograve;a tan c&aacute;c chất lơ lửng.</p>\r\n\r\n<p>D. Cả B, C.</p>\r\n\r\n<p><strong>C&acirc;u 2:</strong>&nbsp;Những v&ugrave;ng nước giếng khoan khi mới m&uacute;c nước l&ecirc;n th&igrave; thấy nước trong, nhưng để l&acirc;u lại thấy nước đục, c&oacute; m&agrave;u n&acirc;u, v&agrave;ng l&agrave; do:</p>\r\n\r\n<p>A. Nước c&oacute; ion Fe2+ n&ecirc;n bị oxi h&oacute;a bởi kh&ocirc;ng kh&iacute; tạo ra Fe(OH)<sub>3</sub>.</p>\r\n\r\n<p>B. Nước c&oacute; c&aacute;c chất bẩn.</p>\r\n\r\n<p>C. Nước chứa nhiều ion Mg2+ v&agrave; Ca2+ n&ecirc;n tạo kết tủa với CO<sub>2</sub>.</p>\r\n\r\n<p>D. Tất cả đều sai.</p>\r\n\r\n<p><strong>C&acirc;u 3</strong>: Để bảo vệ th&acirc;n t&agrave;u người ta thường gắn tấm kẽm v&agrave;o vỏ t&agrave;u bởi v&igrave;:</p>\r\n\r\n<p>A. Tạo ra cặp pin volta m&agrave; kẽm l&agrave; cực &acirc;m n&ecirc;n bị ăn m&ograve;n c&ograve;n vỏ t&agrave;u được bảo vệ.</p>\r\n\r\n<p>B. Kẽm ngăn cản kh&ocirc;ng cho vỏ t&agrave;u tiếp x&uacute;c với dung dịch nước biển.</p>\r\n\r\n<p>C. Kẽm t&aacute;c dụng với gỉ sắt để t&aacute;i tạo ra Fe.</p>\r\n\r\n<p>D. Nguy&ecirc;n nh&acirc;n kh&aacute;c.</p>\r\n\r\n<p><strong>C&acirc;u 4:</strong>&nbsp;Khi đ&aacute;nh rơi thủy ng&acirc;n, kh&ocirc;ng được d&ugrave;ng chổi qu&eacute;t m&agrave; phải rắc bột S l&ecirc;n chỗ c&oacute; Hg v&igrave;:</p>\r\n\r\n<p>A. S ở dạng rắn quyện v&agrave;o Hg lỏng tạo hỗn hợp dễ thu gom.</p>\r\n\r\n<p>B. Hg phản ứng mạnh với S tạo ra HgS rắn dễ thu gom.</p>\r\n\r\n<p>C. Tạo ra hỗn hống Hg-S.</p>\r\n\r\n<p>D. Cả A, C</p>\r\n\r\n<p><strong>C&acirc;u 5:</strong>&nbsp;Khi phun nước rửa sạch đường phố người ta thường cho th&ecirc;m CaCl<sub>2</sub>&nbsp;(rắn) xuống đường v&igrave;:</p>\r\n\r\n<p>A. CaCl<sub>2</sub>&nbsp;c&oacute; khả năng giữ bụi tr&ecirc;n mặt đường.</p>\r\n\r\n<p>B. CaCl<sub>2</sub>&nbsp;rắn c&oacute; khả năng h&uacute;t ẩm tốt n&ecirc;n giữ hơi nước l&acirc;u tr&ecirc;n mặt đường.</p>\r\n\r\n<p>C. CaCl<sub>2</sub>&nbsp;t&aacute;c dụng với nước, l&agrave;m giữ hơi nước l&acirc;u.</p>\r\n\r\n<p>D. Nguy&ecirc;n nh&acirc;n kh&aacute;c</p>\r\n\r\n<p><strong>Đ&aacute;p &aacute;n: 1. A&nbsp;&nbsp; 2. A&nbsp;&nbsp;&nbsp;&nbsp; 3. A&nbsp;&nbsp;&nbsp;&nbsp; 4. B &nbsp;&nbsp;&nbsp; 5. B&nbsp;&nbsp;&nbsp;&nbsp;</strong></p>\r\n\r\n<p>Thực ra mỗi đề b&agrave;i, mỗi c&acirc;u hỏi&nbsp;<strong>trắc nghiệm h&oacute;a 12</strong>&nbsp;d&ugrave; l&yacute; thuyết hay b&agrave;i tập đều y&ecirc;u cầu ch&uacute;ng ta nắm vững c&aacute;c kiến thức v&agrave; gi&uacute;p h&igrave;nh th&agrave;nh n&ecirc;n sự nhạy b&eacute;n khi thi cử. Cũng như c&aacute;c m&ocirc;n học kh&aacute;c, việc l&agrave;m nhiều b&agrave;i&nbsp;<strong>thi thử h&oacute;a</strong>&nbsp;(ngoại tuyến hoặc trực tuyến tr&ecirc;n c&aacute;c website như&nbsp;<a href="http://789.vn/">789.vn</a>) l&agrave; một phương ph&aacute;p rất hữu &iacute;ch để gi&uacute;p bạn vừa hệ thống kiến thức lại c&oacute; thể l&agrave;m quen với c&aacute;c dạng đề v&agrave; đạt kết quả tốt hơn trong kỳ thi sắp tới.</p>', 'Giải đáp những câu hỏi trắc nghiệm hóa 12 thú vị được ứng dụng trong thực tế', 'Giải đáp những câu hỏi trắc nghiệm hóa 12 thú vị được ứng dụng trong thực tế', 'Giải đáp những câu hỏi trắc nghiệm hóa 12 thú vị được ứng dụng trong thực tế', 1, 142),
(136, 'Bật mí 7 phương pháp học từ vựng tiếng anh siêu tốc', 'bat-mi-7-phuong-phap-hoc-tu-vung-tieng-anh-sieu-toc', 'Bạn tự tin mình nghe, nói tốt, thế nhưng khi bắt đầu giao tiếp thì lại trở nên “đông cứng” chỉ vì không biết từ muốn nói đó trong tiếng anh là gì?', NULL, '<h2>1.&nbsp;&nbsp;&nbsp; Ghi ch&eacute;p v&agrave;o sổ</h2>\r\n\r\n<p><img alt="phương pháp học từ vựng tiếng anh " src="http://admin.789.vn/upload/files/bat-mi-7-phuong-phap-hoc-tu-vung-tieng-anh-sieu-toc_4.jpg" style="height:413px; width:550px" title="Sử dụng sổ để ghi chép từ mới, câu nói hay, các thành ngữ được học" /></p>\r\n\r\n<p>Đ&acirc;y l&agrave; một trong những&nbsp;<strong>phương ph&aacute;p học từ vựng tiếng anh</strong>&nbsp;truyền thống nhưng đến nay vẫn rất hiệu quả. D&ugrave; đi đ&acirc;u bạn cũng đừng qu&ecirc;n mang theo b&ecirc;n m&igrave;nh một cuốn sổ nhỏ kh&ocirc;ng chỉ để ghi lại c&aacute;c&nbsp;<strong>từ mới tiếng anh</strong>&nbsp;m&agrave; c&ograve;n l&agrave; những cụm từ, c&acirc;u văn, thơ hay th&agrave;nh ngữ hay ho m&agrave; m&igrave;nh th&iacute;ch. L&agrave;m như vậy th&igrave; kh&ocirc;ng bao l&acirc;u sau bạn cũng đ&atilde; nắm trong tay một quyển từ điển kh&aacute; phong ph&uacute; v&agrave; hữu &iacute;ch.</p>\r\n\r\n<h2>2.&nbsp;&nbsp;&nbsp; Thường xuy&ecirc;n sử dụng từ mới</h2>\r\n\r\n<p><img alt="phương pháp học từ vựng anh văn" src="http://admin.789.vn/upload/files/bat-mi-7-phuong-phap-hoc-tu-vung-tieng-anh-sieu-toc_5.jpg" style="height:367px; width:550px" title="Thường xuyên áp dụng từ vựng vào thực tế là một phương pháp học từ vựng anh văn hiệu quả" /></p>\r\n\r\n<p>Ghi v&agrave;o sổ l&agrave; một điều cần thiết nhưng chỉ như vậy l&agrave; chưa đủ. Sau khi được học một từ mới, trước ti&ecirc;n h&atilde;y nghe ph&aacute;t &acirc;m chuẩn của n&oacute;, sau đ&oacute; li&ecirc;n tục lặp lại thật ch&iacute;nh x&aacute;c, đến khi bạn ph&aacute;t &acirc;m một c&aacute;ch thuần thục m&agrave; kh&ocirc;ng cần nh&igrave;n v&agrave;o s&aacute;ch vở.</p>\r\n\r\n<p>Những g&igrave; đ&atilde; học kh&ocirc;ng được nhắc lại th&igrave; chắc chắn sẽ bị qu&ecirc;n, do đ&oacute; h&atilde;y nhớ xem lại ch&uacute;ng thường xuy&ecirc;n. Nghe c&aacute;c b&agrave;i h&aacute;t, tự đặt c&acirc;u, s&aacute;ng tạo một cuộc hội thoại nhỏ v&agrave; tập n&oacute;i chuyện, viết ra giấy rồi d&aacute;n l&ecirc;n tường hay tham gia c&aacute;c b&agrave;i&nbsp;<strong>thi thử trực tuyến&nbsp;</strong>như hiện nay&hellip; đều l&agrave; những&nbsp;<strong>c&aacute;ch nhớ từ vựng tiếng anh&nbsp;</strong>rất hiệu quả m&agrave; bạn n&ecirc;n tham khảo.</p>\r\n\r\n<h2>3.&nbsp;&nbsp;&nbsp; Li&ecirc;n tưởng từ vựng đến một h&igrave;nh ảnh</h2>\r\n\r\n<p><img alt="phương pháp học từ vựng anh văn" src="http://admin.789.vn/upload/files/bat-mi-7-phuong-phap-hoc-tu-vung-tieng-anh-sieu-toc_6.jpg" style="height:550px; width:550px" title="Liên tưởng đến những hình ảnh liên quan sẽ giúp bạn nhớ từ vựng lâu hơn" /></p>\r\n\r\n<p>Vốn dĩ n&atilde;o bộ con người vẫn c&oacute; khả năng ghi nhớ những h&igrave;nh ảnh tốt hơn so với &acirc;m thanh hay chữ viết n&ecirc;n khi được học hay bắt gặp một từ mới, h&atilde;y nhanh ch&oacute;ng li&ecirc;n tưởng v&agrave; g&aacute;n ch&uacute;ng cho một h&igrave;nh ảnh n&agrave;o đ&oacute; thật quen thuộc. Chẳng hạn như&nbsp;<em>singer&nbsp;</em>th&igrave; h&atilde;y nghĩ ngay đến ca sĩ m&agrave; l&acirc;u nay bạn thần tượng. Như vậy mỗi lần nhắc đến ca sĩ đ&oacute; sẽ l&agrave; một lần bạn hồi tưởng về từ vựng m&agrave; m&igrave;nh đ&atilde; học.</p>\r\n\r\n<h2>4.&nbsp;&nbsp;&nbsp; Sử dụng kỹ thuật t&aacute;ch gh&eacute;p từ</h2>\r\n\r\n<p><strong>Phương ph&aacute;p học từ vựng tiếng anh&nbsp;</strong>n&agrave;y chắc hẳn vẫn c&ograve;n kh&aacute; mới mới với nhiều người v&agrave; n&oacute; chỉ thực sự hiệu quả khi bạn c&oacute; khả năng tưởng tượng, s&aacute;ng tạo tốt.</p>\r\n\r\n<p>N&oacute;i một c&aacute;ch đơn giản th&igrave; kỹ thuật t&aacute;ch gh&eacute;p từ n&agrave;y l&agrave; dựa tr&ecirc;n một từ mới, biến đổi ch&uacute;ng th&agrave;nh một c&acirc;u văn, một cụm từ với những h&igrave;nh ảnh thật sinh động để c&oacute; thể dễ d&agrave;ng nhớ ra ch&uacute;ng khi gặp lại.</p>\r\n\r\n<p>Chẳng hạn khi nhắc đến từ Berate c&oacute; nghĩa l&agrave; nghi&ecirc;m tr&aacute;ch, trừng trị, bạn h&atilde;y nghĩ tới cụm từ Be-a-rat tức l&agrave; một con chuột. Sau đ&oacute; thử li&ecirc;n kết ch&uacute;ng th&agrave;nh một c&acirc;u c&oacute; nghĩa v&agrave; th&uacute; vị như Một cậu b&eacute; v&igrave; qu&aacute; nghịch ngợm n&ecirc;n đ&atilde; bị b&agrave; ti&ecirc;n BERATE (trừng phạt) bằng c&aacute;ch MAKE HIM BE A RAT (biến cậu ấy th&agrave;nh một con chuột).</p>\r\n\r\n<p>Khi &ldquo;kịch bản&rdquo; tạo ra c&agrave;ng hay, c&agrave;ng phong ph&uacute;, độc đ&aacute;o th&igrave; chắc chắn bạn sẽ nhớ từ đ&oacute; c&agrave;ng l&acirc;u hơn.</p>\r\n\r\n<h2>5.&nbsp;&nbsp;&nbsp; Học tất cả những từ c&ugrave;ng gốc</h2>\r\n\r\n<p>Trong tiếng anh, mỗi một từ thường c&oacute; nh&oacute;m c&aacute;c từ c&ugrave;ng gốc, như: Confidence &ndash; danh từ, Confident &ndash; t&iacute;nh từ,&hellip; m&agrave; mỗi trường hợp lại sử dụng một từ kh&aacute;c nhau. Vậy n&ecirc;n khi được học một từ, h&atilde;y cố gắng t&igrave;m ra những từ li&ecirc;n quan c&ograve;n lại để đưa v&agrave;o ngữ cảnh một c&aacute;ch ch&iacute;nh x&aacute;c v&agrave; mở rộng vốn ng&ocirc;n ngữ cho m&igrave;nh.</p>\r\n\r\n<h2>6.&nbsp;&nbsp;&nbsp; Ghi nhớ những từ c&oacute; li&ecirc;n quan trong c&ugrave;ng 1 chủ đề</h2>\r\n\r\n<p><img alt="phương pháp học từ vựng tiếng anh" src="http://admin.789.vn/upload/files/bat-mi-7-phuong-phap-hoc-tu-vung-tieng-anh-sieu-toc_3.jpg" style="height:367px; width:550px" title="Ghi nhớ những từ có liên quan trong cùng 1 chủ đề" /></p>\r\n\r\n<p>Tương tự như&nbsp;<strong>b&iacute; quyết học từ vựng tiếng anh&nbsp;</strong>b&ecirc;n tr&ecirc;n, thay v&igrave; chỉ nắm được một từ duy nhất th&igrave; bạn cần tham khảo th&ecirc;m cả những thứ tương tự trong c&ugrave;ng một nh&oacute;m, chủ đề. Bởi khi sử dụng đến một từ trong nh&oacute;m, bạn tự động sẽ c&oacute; sự li&ecirc;n tưởng, kết nối đến những từ c&ograve;n lại m&agrave; trước đ&acirc;y đ&atilde; từng học qua.</p>\r\n\r\n<p>Thực chất&nbsp;<strong>phương ph&aacute;p học từ vựng tiếng anh&nbsp;</strong>đ&oacute; vẫn được &aacute;p dụng trong s&aacute;ch từ trước đến nay. V&iacute; như khi học về chủ đề Restaurant (nh&agrave; h&agrave;ng), ắt hẳn sẽ c&oacute; c&aacute;c từ quen thuộc như waiter, waitress, food, water, wine&hellip; c&ugrave;ng rất nhiều t&ecirc;n m&oacute;n ăn xuất hiện trong b&agrave;i học.</p>', 'Bật mí 7 phương pháp học từ vựng tiếng anh siêu tốc', 'Bạn tự tin mình nghe, nói tốt, thế nhưng khi bắt đầu giao tiếp thì lại trở nên “đông cứng” chỉ vì không biết từ muốn nói đó trong tiếng anh là gì? Thực chất trường hợp này lại khá phổ biến bởi việc học từ vựng từ trước đến nay vốn vẫn được xem là “nổi ám ảnh” của nhiều người. Vậy đâu là phương pháp học từ vựng tiếng anh giúp bạn học nhanh và nhớ lâu nhất?', 'Bật mí 7 phương pháp học từ vựng tiếng anh siêu tốc', 1, 143),
(137, 'Bạn có thể “vượt qua” 3 câu hỏi trắc nghiệm sinh học cực khó này không?', 'ban-co-the-vuot-qua-3-cau-hoi-trac-nghiem-sinh-hoc-cuc-kho-nay-khong', 'Dù là môn thi nào đi chăng nữa thì đối với các dạng đề trắc nghiệm, những câu hỏi cuối thường “hóc búa” nhất và dĩ nhiên tỷ lệ học sinh làm được không cao. Những dạng này không chỉ đòi hỏi bạn phải trang bị kiến thức toàn diện mà phải có sự nâng cao và hiểu được sâu sắc bản chất của các bài học. Trong đó, đề thi trắc nghiệm sinh học cũng không phải là một ngoại lệ. Để có thêm nhiều kinh nghiệm thi đại học và đạt điểm số cao hơn ở môn này, bạn nên thường xuyên làm các bài thi thử sinh học cũng như tìm kiếm và thử sức “giải quyết” một vài câu hỏi khó nhằn như dưới đây.', NULL, '<p><strong>C&acirc;u 1.</strong>&nbsp;Ở một quần thể người, bệnh X do một trong hai alen của một gen quy định. Một cặp vợ chồng: Nam bị bệnh X c&ograve;n Lan th&igrave; kh&ocirc;ng. Họ sinh được con g&aacute;i l&agrave; Uy&ecirc;n kh&ocirc;ng bị bệnh X. Sau đ&oacute;, Uy&ecirc;n kết h&ocirc;n với Tuấn (Tuấn cũng kh&ocirc;ng bị bệnh v&agrave; đến từ một quần thể kh&aacute;c đang ở trạng th&aacute;i c&acirc;n bằng di truyền c&oacute; tần số alen g&acirc;y bệnh X l&agrave; 1/10) v&agrave; c&oacute; được một người con g&aacute;i l&agrave; Ti&ecirc;n kh&ocirc;ng bị bệnh X.</p>\r\n\r\n<p>Một cặp vợ chồng kh&aacute;c l&agrave; L&acirc;m v&agrave; Hương đều kh&ocirc;ng mắc bệnh tr&ecirc;n nhưng khi sinh 2 người con th&igrave; con g&aacute;i l&agrave; Thương bị mắc bệnh X trong khi con trai l&agrave; Thắng b&igrave;nh thường. Sau n&agrave;y khi Thắng kết h&ocirc;n với Ti&ecirc;n v&agrave; sinh con g&aacute;i đầu l&ograve;ng l&agrave; Huyền ho&agrave;n to&agrave;n khoẻ mạnh, kh&ocirc;ng bị bệnh X.</p>\r\n\r\n<p>Biết rằng kh&ocirc;ng xảy ra đột biến mới ở tất cả những người trong c&aacute;c gia đ&igrave;nh. Dựa v&agrave;o c&aacute;c th&ocirc;ng tin tr&ecirc;n, h&atilde;y cho biết, trong c&aacute;c dự đo&aacute;n sau, c&oacute; bao nhi&ecirc;u dự đo&aacute;n đ&uacute;ng?</p>\r\n\r\n<p><strong>1-</strong>&nbsp;X&aacute;c suất để Huyền mang alen g&acirc;y bệnh X l&agrave; 53/115.</p>\r\n\r\n<p><strong>2-</strong>&nbsp;X&aacute;c suất sinh con thứ hai l&agrave; trai kh&ocirc;ng bị bệnh M của Thắng v&agrave; Ti&ecirc;n l&agrave; 115/252.</p>\r\n\r\n<p><strong>3-</strong>&nbsp;C&oacute; thể biết ch&iacute;nh x&aacute;c kiểu gen của 5 người trong c&aacute;c gia đ&igrave;nh tr&ecirc;n.</p>\r\n\r\n<p><strong>4-</strong>&nbsp;X&aacute;c suất để Tuấn mang alen g&acirc;y bệnh M l&agrave; 5/11.</p>\r\n\r\n<ol>\r\n	<li>1&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; B. 2&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; C.3 &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; D.4</li>\r\n</ol>\r\n\r\n<p><strong>C&acirc;u 2:</strong>&nbsp;Từ một tế b&agrave;o x&ocirc;ma c&oacute; bộ nhiễm sắc thể lưỡng bội 2n, qua một số lần nguy&ecirc;n ph&acirc;n li&ecirc;n tiếp tạo ra c&aacute;c tế b&agrave;o con. Tuy nhi&ecirc;n, trong một lần ph&acirc;n b&agrave;o, ở một tế b&agrave;o con c&oacute; hiện tượng tất cả c&aacute;c nhiễm sắc thể kh&ocirc;ng ph&acirc;n li n&ecirc;n chỉ tạo ra một tế b&agrave;o c&oacute; bộ nhiễm sắc thể 4n. Tế b&agrave;o 4n n&agrave;y v&agrave; c&aacute;c tế b&agrave;o con kh&aacute;c tiếp tục nguy&ecirc;n ph&acirc;n b&igrave;nh thường với chu k&igrave; tế b&agrave;o như nhau. Kết th&uacute;c qu&aacute; tr&igrave;nh nguy&ecirc;n ph&acirc;n tr&ecirc;n tạo ra 240 tế b&agrave;o con. Theo l&iacute; thuyết, trong số c&aacute;c tế b&agrave;o con tạo th&agrave;nh, c&oacute; bao nhi&ecirc;u tế b&agrave;o c&oacute; bộ nhiễm sắc thể 2n?</p>\r\n\r\n<p>A. 128&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; B. 208&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; C. 212&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; D. 224</p>\r\n\r\n<p><strong>C&acirc;u 3:</strong>&nbsp;Ở một lo&agrave;i c&ocirc;n tr&ugrave;ng, cặp nhiễm sắc thể giới t&iacute;nh ở giới c&aacute;i l&agrave; XX, giới đực l&agrave; XY; t&iacute;nh trạng m&agrave;u c&aacute;nh do hai cặp gen ph&acirc;n li độc lập c&ugrave;ng quy định. Cho con c&aacute;i c&aacute;nh đen thuần chủng lai với con đực c&aacute;nh trắng thuần chủng (P), thu được F1 to&agrave;n con c&aacute;nh đen. Cho con đực F1 lai với con c&aacute;i c&oacute; kiểu gen đồng hợp tử lặn, thu được Fa c&oacute; kiểu h&igrave;nh ph&acirc;n li theo tỉ lệ l&agrave; 2 con đực c&aacute;nh trắng : 1 con c&aacute;i c&aacute;nh đen : 1 con c&aacute;i c&aacute;nh trắng. Cho F1 giao phối ngẫu nhi&ecirc;n thu được F2. Theo l&iacute; thuyết, trong số con c&aacute;nh trắng ở F2, số con đực chiếm tỉ lệ l&agrave; bao nhi&ecirc;u?</p>\r\n\r\n<p>A. 1/3&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; B. 2/3&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; C. 3/5&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; D. 5/7</p>\r\n\r\n<p><strong>Đ&Aacute;P &Aacute;N</strong></p>\r\n\r\n<ol>\r\n	<li><strong>1.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</strong><strong>C&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2. D &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 3. D</strong></li>\r\n</ol>\r\n\r\n<p>Để được l&agrave;m nhiều b&agrave;i&nbsp;<strong>thi thử sinh học</strong>&nbsp;hơn, h&atilde;y truy cập đến website ng&acirc;n h&agrave;ng đề&nbsp;<strong>thi trắc nghiệm đại học</strong>&nbsp;<a href="http://789.vn/">789.vn</a>&nbsp;hoặc li&ecirc;n hệ hotline: 0913 36 50 79 để được hướng dẫn chi tiết nh&eacute;!</p>', 'Bạn có thể “vượt qua” 3 câu hỏi trắc nghiệm sinh học cực khó này không?', 'Bạn có thể “vượt qua” 3 câu hỏi trắc nghiệm sinh học cực khó này không?', 'Bạn có thể “vượt qua” 3 câu hỏi trắc nghiệm sinh học cực khó này không?', 1, 144),
(138, '4 bí kíp học toán thi đại học đạt điểm cao', '4-bi-kip-hoc-toan-thi-dai-hoc-dat-diem-cao', 'Trong những năm gần đây, kỳ thi đại học và THPT liên tục có nhiều đổi mới, trong đó đáng chú ý là hình thức thi môn toán đã được chuyển qua 100% trắc nghiệm kể từ năm 2017. Điều đó kéo theo cả phương pháp dạy và học môn này đều cần thay đổi cho phù hợp hơn với hình thức mới. Hãy cùng 789.vn điểm danh qua 4 bí kíp dưới đây để xem học toán thi đại học như thế nào mới có thể đạt điểm cao hơn trong các bài thi trắc nghiệm.', NULL, '<h2>1.&nbsp; Học chắc những kiến thức trong s&aacute;ch gi&aacute;o khoa</h2>\r\n\r\n<p>Tr&ecirc;n thực tế, d&ugrave; l&agrave; thi theo h&igrave;nh thức&nbsp;<strong>thi to&aacute;n trắc nghiệm</strong>&nbsp;hay tự luận th&igrave; quan trọng nhất vẫn l&agrave; nắm chắc c&aacute;c kiến thức trong s&aacute;ch gi&aacute;o khoa trước khi muốn học th&ecirc;m c&aacute;c kiến thức n&acirc;ng cao. Đặc biệt với dạng b&agrave;i 100% trắc nghiệm, việc học tủ thực sự rất nguy hiểm bởi đề thi thường ph&acirc;n bố đều cho tất cả c&aacute;c dạng, y&ecirc;u cầu lượng kiến thức rộng n&ecirc;n bạn kh&ocirc;ng thể bỏ qua bất k&igrave; phần n&agrave;o, kể cả s&aacute;ch b&agrave;i tập hay phần đọc th&ecirc;m.</p>\r\n\r\n<h2>2. Sử dụng th&agrave;nh thạo m&aacute;y t&iacute;nh Casio</h2>\r\n\r\n<p><img alt="máy tính casio, học toán thi đại học" src="http://admin.789.vn/upload/files/4-bi-kip-hoc-toan-thi-dai-hoc-hieu-qua_2.jpg" style="height:359px; width:550px" title="Sử dụng thành thạo máy tính casio là một lợi thế lớn khi thi trắc nghiệm" /></p>\r\n\r\n<p>Với c&aacute;c m&ocirc;n học ban tự nhi&ecirc;n, m&aacute;y t&iacute;nh Casio l&agrave; &ldquo;vũ kh&iacute;&rdquo; kh&ocirc;ng thể thiếu của mỗi học sinh. Tuy nhi&ecirc;n hiện nay khi&nbsp;<strong>học to&aacute;n thi đại học</strong>, bạn kh&ocirc;ng chỉ học phương ph&aacute;p l&agrave;m b&agrave;i m&agrave; th&ecirc;m v&agrave;o đ&oacute; l&agrave; c&aacute;ch giải c&aacute;c b&agrave;i to&aacute;n đ&oacute; tr&ecirc;n m&aacute;y t&iacute;nh Casio thật nhanh để r&uacute;t gọn thời gian. Thường th&igrave; c&aacute;c chuy&ecirc;n đề nguy&ecirc;n h&agrave;m, t&iacute;ch ph&acirc;n, số phức, mũ&hellip; đều c&oacute; một v&agrave;i c&ocirc;ng thức để t&iacute;nh to&aacute;n nhanh tr&ecirc;n m&aacute;y t&iacute;nh bỏ t&uacute;i, bạn h&atilde;y tận dụng ch&uacute;ng để d&agrave;nh thời gian giải quyết c&aacute;c c&acirc;u kh&oacute; hơn v&agrave; kiểm tra lại độ ch&iacute;nh x&aacute;c c&aacute;c đ&aacute;p &aacute;n đ&atilde; chọn.</p>\r\n\r\n<h2>3. &ldquo;Cải c&aacute;ch&rdquo; tư duy học to&aacute;n thi đại học</h2>\r\n\r\n<p><img alt="học toán thi đại học, thi trắc nghiệ," src="http://admin.789.vn/upload/files/4-bi-kip-hoc-toan-thi-dai-hoc-hieu-qua_3.jpg" style="height:309px; width:550px" title="Phương pháp học của học sinh THPT cần có nhiều thay đổi để phù hợp hơn với hình thức trắc nghiệm" /></p>\r\n\r\n<p>Một ưu điểm lớn của kiểu thi&nbsp;<strong>to&aacute;n trắc nghiệm</strong>&nbsp;kh&aacute;ch quan l&agrave; bạn kh&ocirc;ng cần quan t&acirc;m đến c&aacute;ch tr&igrave;nh b&agrave;y sao cho r&otilde; r&agrave;ng, logic m&agrave; chỉ tập trung v&agrave;o việc giải như thế n&agrave;o nhanh v&agrave; ch&iacute;nh x&aacute;c nhất. Tuy nhi&ecirc;n, việc n&agrave;y cũng khiến th&iacute; sinh &aacute;p lực hơn về thời gian giải đề v&agrave; điểm chỉ được t&iacute;nh cho đ&aacute;p &aacute;n cuối c&ugrave;ng đ&atilde; chọn m&agrave; kh&ocirc;ng cần biết bạn đ&atilde; sử dụng phương ph&aacute;p g&igrave; hay c&aacute;c bước l&agrave;m ra sao.</p>\r\n\r\n<p>Theo kinh nghiệm của nhiều bạn từng đạt điểm cao trong k&igrave; thi THPT, trước khi bắt đầu l&agrave;m b&agrave;i, h&atilde;y h&igrave;nh th&agrave;nh trong đầu tư tưởng chia n&oacute; th&agrave;nh 3 lượt theo mức độ kh&oacute; của c&acirc;u hỏi thay v&igrave; cứ tuần tự l&agrave;m từ tr&ecirc;n xuống dưới.</p>\r\n\r\n<p>Lượt đầu ti&ecirc;n để giải quyết nhanh gọn nhất c&aacute;c c&acirc;u hỏi dễ với tốc độ mỗi c&acirc;u khoảng 1 ph&uacute;t. Tiếp theo d&agrave;nh khoảng 2 ph&uacute;t cho c&aacute;c c&acirc;u mức trung b&igrave;nh. Cuối c&ugrave;ng l&agrave; xử l&yacute; những b&agrave;i kh&oacute; v&agrave; cực kh&oacute; với thời gian trung b&igrave;nh 3.5 ph&uacute;t/ c&acirc;u.</p>\r\n\r\n<p>Trong trường hợp kh&ocirc;ng t&igrave;m ra được một đ&aacute;p &aacute;n ph&ugrave; hợp với kết quả l&agrave;m ra, bạn tuyệt đối kh&ocirc;ng được bỏ trống m&agrave; n&ecirc;n chọn ngẫu nhi&ecirc;n một c&acirc;u trả lời n&agrave;o đ&oacute;, &iacute;t nhất vẫn c&oacute; 25% cơ hội chọn đ&uacute;ng.</p>\r\n\r\n<h2>4. Luyện thi thử trắc nghiệm thường xuy&ecirc;n</h2>\r\n\r\n<p><img alt="học toán thi đại học, luyện thi thử trắc nghiệm" src="http://admin.789.vn/upload/files/4-bi-kip-hoc-toan-thi-dai-hoc-hieu-qua_4.jpg" style="height:322px; width:550px" title="Học sinh cần luyện thi thử trắc nghiệm thường xuyên để làm quen với hình thức và áp lực thi cử" /></p>\r\n\r\n<p>Một người học to&aacute;n tốt chưa chắc họ sẽ suốt ng&agrave;y v&ugrave;i đầu v&agrave;o giải to&aacute;n m&agrave; c&aacute;i họ c&oacute; được trong tay l&agrave; nhiều hướng tiếp cận v&agrave; c&aacute;c c&ocirc;ng cụ giải tối ưu. L&agrave;m bằng kiểu n&agrave;y kh&ocirc;ng được họ ngay lập tức chuyển qua kiểu kh&aacute;c. Dĩ nhi&ecirc;n để đạt được tr&igrave;nh độ như vậy th&igrave; chẳng c&oacute; c&aacute;ch n&agrave;o ngo&agrave;i việc l&agrave;m nhiều dạng b&agrave;i, đề kh&aacute;c nhau nhằm r&egrave;n luyện sự nhạy b&eacute;n, phản xạ cũng như quen dần với &aacute;p lực thi cử. Hiện nay&nbsp;<strong>thi thử trắc nghiệm</strong>&nbsp;tr&ecirc;n c&aacute;c website luyện thi trực tuyến như&nbsp;<a href="http://789.vn/">789.vn</a>&nbsp;được xem l&agrave; giải ph&aacute;p kh&aacute; tối ưu cho cả gi&aacute;o vi&ecirc;n cũng như học sinh đang trong giai đoạn&nbsp;<strong>học to&aacute;n thi đại học</strong>&nbsp;bởi t&iacute;nh đa dạng của m&atilde; đề, sự tiện dụng v&agrave; tiết kiệm rất nhiều thời gian.</p>', '4 bí kíp học toán thi đại học đạt điểm cao', '4 bí kíp học toán thi đại học đạt điểm cao', '4 bí kíp học toán thi đại học đạt điểm cao', 1, 145),
(139, 'Danh sách các trường Đại học công bố phương án tuyển sinh 2017', 'danh-sach-cac-truong-dai-hoc-cong-bo-phuong-an-tuyen-sinh-2017', 'Năm 2017 với nhiều đổi mới trong kì thi THPT Quốc gia và quy chế tuyển sinh. Theo dự thảo, thí sinh không bị giới hạn số lượng nguyện vọng xét tuyển, thí sinh sẽ đăng kí nguyện vọng trước khi thi,...', NULL, '<p>https://hoctapaz.dev/storage/app/public/articles/photo_seo/photo_seo/ShRPlUKOAF6nsfhaiGNl5FIsMivei28kNNvNG3Nk.jpeghttps://hoctapaz.dev/storage/app/public/articles/photo_seo/photo_seo/ShRPlUKOAF6nsfhaiGNl5FIsMivei28kNNvNG3Nk.jpeg<img src="https://hoctapaz.dev/storage/app/public/articles/photo_seo/photo_seo/ShRPlUKOAF6nsfhaiGNl5FIsMivei28kNNvNG3Nk.jpeg" class="thumbnail" style="width: 100%;height: auto;"><img src="https://hoctapaz.dev/storage/app/public/summernote_data/xuFQDJPGna8BxeJk5uTBG03MDB3Q7HuQkk6zvG6p.jpeg" style="width: 500px;"><img src="https://hoctapaz.dev/storage/app/public/summernote_data/deOf0vXsmD2CeoEtTWhZBvOi9Xw0roRMrmUNMyfP.jpeg" style="width: 228px;"><img src="https://hoctapaz.dev/storage/app/public/summernote_data/Rt6pff6ZDD6DIFUkkjHXHtjw2Pfr2blWxQBVIaBs.jpeg" style="width: 228px;"><br></p>', 'Danh sách các trường Đại học công bố phương án tuyển sinh 2017', 'Danh sách các trường Đại học công bố phương án tuyển sinh 2017', 'Danh sách các trường Đại học công bố phương án tuyển sinh 2017', 1, 146),
