(39, 'Casio DH-14', 'Casio DH-14', '- Máy tính Casio DH-14\r\n- Màn hình cực lớn giúp đọc dữ liệu dễ dàng hơn\r\n- Dạng trung, 14 số, phím bấm rộng, nút chức năng, sử dụng pin và năng lượng mặt trời\r\n- Chức năng: thống kê tính toán sổ sách văn phòng\r\n- Kích thước: 28,5(cao) x 151(rộng) x 159mm (dài)\r\n- Thời gian bảo hành: 24 tháng\r\n- Hãng sản xuất: Casio (Nhật Bản)  \r\n- Đơn vị tính: Bộ', 65, 1, 0, 0, 'Casio-DH-14', 'Casio DH-14', 'Casio DH-14', 'Casio DH-14'),
