(41, 'Casio MS-20NC', 'Casio MS-20NC', '- Máy tính Casio MS-20NC (Thay thế cho Casio MS-10VC)\r\n- Màn hình lớn giúp đọc dữ liệu dễ dàng hơn\r\n- Dạng trung, 12 số, phím bấm rộng, nút chức năng, sử dụng pin và năng lượng mặt trời\r\n- Chức năng: thống kê tính toán sổ sách văn phòng\r\n- Kích thước: 22,1(cao) x 104,5(rộng) x 149,5mm (dài)\r\n- Thời gian bảo hành: 24 tháng\r\n- Hãng sản xuất: Casio (Nhật Bản)  \r\n- Đơn vị tính: Bộ', 67, 1, 0, 0, 'Casio-MS-20NC', 'Casio MS-20NC', 'Casio MS-20NC', 'Casio MS-20NC'),
(42, 'Casio SL-100VC 1', 'Casio SL-100VC', '- Máy tính Casio SL-100VC\r\n- Màn hình lớn giúp đọc dữ liệu dễ dàng hơn\r\n- Dạng trung, 8 số, phím bấm rộng, nút chức năng, sử dụng pin và năng lượng mặt trời\r\n- Chức năng: thống kê tính toán sổ sách văn phòng\r\n- Kích thước: 9,4(cao) x 91(rộng) x 110,5mm (dài)\r\n- Thời gian bảo hành: 24 tháng\r\n- Hãng sản xuất: Casio (Nhật Bản)  \r\n- Đơn vị tính: Bộ', 68, 1, 0, 0, 'casio-sl-100vc-1', 'Casio SL-100VC', 'Casio SL-100VC', 'Casio SL-100VC'),
(43, 'Giấy Accura A4 70gsm', 'Giấy Accura A4 70gsm', '- Giấy Accura\r\n- Kích thước: A4 (210mm x 297mm), định lượng: 70gms, nền giấy trắng\r\n- Chức năng: in ấn chứng từ cao cấp, hợp đồng, thiết kế, mỹ thuật\r\n- Đơn vị tính: Ream', 69, 1, 0, 0, 'giay-accura-a4-70gsm', 'Giấy Accura A4 70gsm', 'Giấy Accura A4 70gsm', 'Giấy Accura A4 70gsm'),
(44, 'Giấy Delight A3 70gsm', 'Giấy Delight A3 70gsm', 'Đặc điểm: Giấy Delight A3 - 70gsm: Loại giấy in cao cấp, trắng, đẹp, thích hợp với tất cả các loại máy in phun, máy in laser, máy fax laser, máy photocopy. In đảo 2 mặt không lo kẹt giấy. Giấy được đóng gói và nhập khẩu từ Thailand.\r\n\r\nChất lượng: Giấy in cao cấp, Đẹp, trắng, mịn, láng.\r\n\r\nQuy cách: Khổ A3 (420x297mm)\r\n\r\nĐịnh lượng: 70gsm\r\n\r\nSản xuất tại: Thailand\r\n\r\nĐóng gói tại:  500 tờ/ream, 5 ream/thùng.\r\n\r\nBảo quản: Nhiệt độ: 10 ~ 55º C. Độ ẩm: 55 ~ 95% RH. Tránh xa nguồn nhiệt, dầu mỡ.', 70, 1, 0, 0, 'Casio-DH-14-1', 'Giấy Delight A3 70gsm', 'Giấy Delight A3 70gsm', 'Giấy Delight A3 70gsm'),
(45, 'Bìa 3 dây simili 7F Trà My', 'Bìa 3 dây simili 7F Trà My', '- Bìa lưu hồ sơ 3 dây Trà My\r\n- Kích thước: gáy dày 7 cm, bìa bọc simili cao cấp\r\n- Chức năng: chứa hồ sơ, đựng giấy tờ rất chuyên nghiệp, tiện dụng.\r\n- NSX: Việt Nam - Đơn vị tính: Cái', 71, 1, 0, 0, 'bia-3-day-simili-7f-tra-my', 'Bìa 3 dây simili 7F Trà My', 'Bìa 3 dây simili 7F Trà My', 'Bìa 3 dây simili 7F Trà My');
