(1, 1, 52, NULL, 'hoi-dap', NULL, NULL, 'qa', NULL, 'Hỏi đáp toán 12 - 1', NULL, '<p>\\jehiwjadm sjdpoaj ;fjpjfp kajpfjapwoe pfewhiaeipfjwpe joaejf webweo neohfeoafi</p>', 0, NULL, NULL, NULL, NULL, NULL, NULL, '2017-11-15 07:08:05', '2017-11-15 07:08:05'),
(2, 1, 52, NULL, 'hoi-dap', NULL, NULL, 'qa', NULL, 'O là 1 điểm tùy ý nằm trong tam giác đều ABC . Kẻ OI//AB ( I thuộc AC ) , OJ//BC ( J thuộc AB ) , OK//AC ( K thuộc BC )CMR : Chu vi tam giác IJK = OA+OB+OC', NULL, '<p>O l&agrave; 1 điểm t&ugrave;y &yacute; nằm trong tam gi&aacute;c đều ABC . Kẻ OI//AB ( I thuộc AC ) , OJ//BC ( J thuộc AB ) , OK//AC ( K thuộc BC )CMR : Chu vi tam gi&aacute;c IJK = OA+OB+OC</p>', 0, NULL, NULL, NULL, NULL, NULL, NULL, '2017-11-15 07:11:52', '2017-11-15 07:11:52'),
(3, 1, 52, NULL, 'hoi-dap', NULL, NULL, 'qa', NULL, 'Giải đề Cho góc ABC có góc A = 50 độ, AB = AC, tính số đo các góc B và C', NULL, '<p>Cho g&oacute;c ABC c&oacute; g&oacute;c A = 50 độ, AB = AC, t&iacute;nh số đo c&aacute;c g&oacute;c B v&agrave; C</p>', 0, NULL, NULL, NULL, NULL, NULL, NULL, '2017-11-15 07:18:12', '2017-11-15 07:18:12'),
(4, 49, 52, NULL, 'hoi-dap', NULL, NULL, 'qa', NULL, 'Giải đề toán giữa kì', NULL, '<p>Giải đề&nbsp;<img alt="2\\int 2x\\frac{1}{2}\\sqrt{25}" src="http://latex.codecogs.com/gif.latex?2%5Cint%202x%5Cfrac%7B1%7D%7B2%7D%5Csqrt%7B25%7D" /></p>', 0, NULL, NULL, NULL, NULL, NULL, NULL, '2017-11-16 02:31:17', '2017-11-16 02:31:17'),
(5, 49, 49, NULL, 'hoi-dap', NULL, NULL, 'qa', NULL, 'Giải đề toán 9 đại số', NULL, '<p>22<img alt="\\oint_{2}^{3} \\frac{2a}{4a} \\left [ 23 + \\frac{2}{3} \\right ] \\sum \\lim_{3\\rightarrow 5}" src="http://latex.codecogs.com/gif.latex?%5Coint_%7B2%7D%5E%7B3%7D%20%5Cfrac%7B2a%7D%7B4a%7D%20%5Cleft%20%5B%2023%20&amp;plus;%20%5Cfrac%7B2%7D%7B3%7D%20%5Cright%20%5D%20%5Csum%20%5Clim_%7B3%5Crightarrow%205%7D" /></p>\r\n\r\n<p><img alt="\\oint_{1}^{2} \\frac{2b}{4a} \\left [ 23 + \\frac{2}{3} \\right ] \\sum \\lim_{3\\rightarrow 3} \\sqrt{2}" src="http://latex.codecogs.com/gif.latex?%5Coint_%7B1%7D%5E%7B2%7D%20%5Cfrac%7B2b%7D%7B4a%7D%20%5Cleft%20%5B%2023%20&amp;plus;%20%5Cfrac%7B2%7D%7B3%7D%20%5Cright%20%5D%20%5Csum%20%5Clim_%7B3%5Crightarrow%203%7D%20%5Csqrt%7B2%7D" /></p>\r\n\r\n<p><img alt="\\int_{1}^{2} 6\\sin x + \\cos x" src="http://latex.codecogs.com/gif.latex?%5Cint_%7B1%7D%5E%7B2%7D%206%5Csin%20x%20&amp;plus;%20%5Ccos%20x" /></p>', 0, NULL, NULL, NULL, NULL, NULL, NULL, '2017-11-16 03:46:06', '2017-11-16 03:46:06'),
